import React, { Component } from 'react'
import PropTypes from 'prop-types'
import Button from '@material-ui/core/Button'
import Divider from '@material-ui/core/Divider'
import IconButton from '@material-ui/core/IconButton'
import { withStyles } from '@material-ui/core/styles'
import { palette } from '../../constants/styles'
import logoIcon from '../../images/logo-full.png'
import menuIcon from '../../images/menu.svg'
import closeIcon from '../../images/close.svg'

const styles = {
  button: {
    padding: '0 15px 0 15px',
    textDecoration: 'none'
  },

  selectedButton: {
    padding: '0 15px 0 15px',
    textDecoration: 'underline'
  },

  container: {
    display: 'flex',
    flexDirection: 'column'
  },

  contentContainer: {
    alignItems: 'center',
    background: palette.black[-1],
    display: 'flex',
    justifyContent: 'space-between',
    flexDirection: 'row',
    height: '80px',
    padding: '0 20px 0 20px',

    '@media (min-width:500px)': {

    },
  },

  logoIcon: {
    objectFit: 'contain',
    height: '30px',
  },

  iconButton: {
    height: '30px',
    width: '30px',
  },

  menuIcon: {
    color: palette.blue[0],
  },

  paper: {
    position: 'absolute',
    width: '100%',
    boxShadow: 'none',
    borderRadius: '5px',

    '@media (min-width:780px)': {
      top: '20%',
      width: '500px',
      border: '1px solid',
      borderColor: palette.gray[0]
    },
  },
}

class NavigationBar extends Component {

  render() {
    const { classes } = this.props

    return (
      <div className={classes.container}>
        <div className={classes.contentContainer}>
          <img src={logoIcon} className={classes.logoIcon} alt="" />
          <div>
            <Button className={classes.selectedButton}>My Wallet</Button>
            <Button className={classes.button}>Buy Bitcoin</Button>
            <Button className={classes.button}>Education</Button>
          </div>
        </div>
        <Divider />

        <div className={classes.address}></div>
      </div>
    )
  }
}

NavigationBar.propTypes = {
  classes: PropTypes.object.isRequired
}

export default withStyles(styles)(NavigationBar)

